import React, { useEffect, useState } from "react";
import "./UserList.css"

const UserList = ({ socket }: any) => {
	const [userList, setUserList] = useState<{id: string, room: string}[]>();

	useEffect(() => {
	  socket.on("UserList", (newUser:{id: string, room: string}[]) => {
		setUserList(newUser);
	  });

	  return () => {
		socket.disconnect();
	  };
	}, [socket]);


	return (
		<div>
		{userList?.map(user=>
			<div className="userList">
				<div className="id">{user.id}</div>
				<div className="room">{user.room}</div>
			</div>
		)}
			<div className="userList">
				<div className="id">jinkim</div>
				<div className="room">room1</div>
				<div className="id">jinkim2</div>
				<div className="room">room1</div>
			</div>
		</div>
	);
  };
  export default UserList;
